import React from "react";
import ProjectPage from "../../ProjectPage.js";

function content1() {
  return (
    <>
      <p>Hello world!</p>
      <div className="content-container">
        <ProjectPage
          src="images/img-1.jpg"
          alt="project 1"
          header="Project 1"
          para="Hello!"
        />
      </div>
    </>
  );
}

export default content1;
